webpackJsonp([37915026519876],{668:function(e,n){e.exports={data:{markdownRemark:{html:"<h1>chorus</h1>\n<p>G                             Em\nShes as hot as a three dollar pistol\nG                             Em\nHer dress it fits like a glove\nG                             Em\nIts clearer than Waterford Crystal\nG              C           D\nThat She's The Pine Of The Pub</p>\n<h1>verse 1</h1>\n<p>On night with a dog moon in the sky\nI welcoming pub caught me eye\nTwas a place I aint been before\nSo, I took off me hat, and I opened the door</p>\n<p>The bar was a buzzing and full\nI grabbed the last open stool\nI asked the barkeep for porter\nWhile I waited looked round shoulder to shoulder</p>\n<h1>verse 2</h1>\n<p>I flag the barkeep back over\nWill you do a favor my friend\nSend a drink to the fine looking maiden\nas I push in me stool once again</p>\n<p>I asked her her name and she smiled\nher face made a sparkling glance\nWe talked an laughed for awhile\nThen I asked her if shed like to dance</p>\n<h1>verse 3</h1>\n<p>We danced round the room I was on such a high\nBuying round after round I let me sovereigns a fly\nThe night twas one of the best in me life\nI was ready to take this fine lass for me wife</p>\n<p>The night ends I ask her back to me place\nthats when I found me efforts where all just a waste\nshe said was taken by the barkeep right there\nIf made more advances i'd better beware</p>",frontmatter:{title:"Pine Of The Pub"},fields:{date:null}}},pathContext:{slug:"/songs/pine-of-the-pub/"}}}});
